    <<_:Length/binary, Rest2/binary>> = Rest,
    dfp_read_field_def_cs_10001(Rest2, 0, 0, F@_1, F@_2,
				F@_3, TrUserData).

skip_group_cs_10001(Bin, FNum, Z2, F@_1, F@_2, F@_3,
		    TrUserData) ->
    {_, Rest} = read_group(Bin, FNum),
    dfp_read_field_def_cs_10001(Rest, 0, Z2, F@_1, F@_2,
				F@_3, TrUserData).

