d_msg_sc_10011(Bin, TrUserData) ->
    dfp_read_field_def_sc_10011(Bin, 0, 0,
				id(undefined, TrUserData),
				id(undefined, TrUserData), TrUserData).

dfp_read_field_def_sc_10011(<<8, Rest/binary>>, Z1, Z2,
			    F@_1, F@_2, TrUserData) ->
    d_field_sc_10011_result(Rest, Z1, Z2, F@_1, F@_2,
			    TrUserData);
dfp_read_field_def_sc_10011(<<18, Rest/binary>>, Z1, Z2,
			    F@_1, F@_2, TrUserData) ->
    d_field_sc_10011_cpOrderId(Rest, Z1, Z2, F@_1, F@_2,
			       TrUserData);
dfp_read_field_def_sc_10011(<<>>, 0, 0, F@_1, F@_2,
			    _) ->
    #sc_10011{result = F@_1, cpOrderId = F@_2};
dfp_read_field_def_sc_10011(Other, Z1, Z2, F@_1, F@_2,
			    TrUserData) ->
    dg_read_field_def_sc_10011(Other, Z1, Z2, F@_1, F@_2,
			       TrUserData).

dg_read_field_def_sc_10011(<<1:1, X:7, Rest/binary>>, N,
			   Acc, F@_1, F@_2, TrUserData)
    when N < 32 - 7 ->
    dg_read_field_def_sc_10011(Rest, N + 7, X bsl N + Acc,
			       F@_1, F@_2, TrUserData);
dg_read_field_def_sc_10011(<<0:1, X:7, Rest/binary>>, N,
			   Acc, F@_1, F@_2, TrUserData) ->
    Key = X bsl N + Acc,
    case Key of
      8 ->
	  d_field_sc_10011_result(Rest, 0, 0, F@_1, F@_2,
				  TrUserData);
      18 ->
	  d_field_sc_10011_cpOrderId(Rest, 0, 0, F@_1, F@_2,
				     TrUserData);
      _ ->
	  case Key band 7 of
	    0 ->
		skip_varint_sc_10011(Rest, 0, 0, F@_1, F@_2,
				     TrUserData);
	    1 ->
		skip_64_sc_10011(Rest, 0, 0, F@_1, F@_2, TrUserData);
	    2 ->
		skip_length_delimited_sc_10011(Rest, 0, 0, F@_1, F@_2,
					       TrUserData);
	    3 ->
		skip_group_sc_10011(Rest, Key bsr 3, 0, F@_1, F@_2,
				    TrUserData);
	    5 ->
		skip_32_sc_10011(Rest, 0, 0, F@_1, F@_2, TrUserData)
	  end
    end;
dg_read_field_def_sc_10011(<<>>, 0, 0, F@_1, F@_2, _) ->
    #sc_10011{result = F@_1, cpOrderId = F@_2}.

d_field_sc_10011_result(<<1:1, X:7, Rest/binary>>, N,
			Acc, F@_1, F@_2, TrUserData)
    when N < 57 ->
    d_field_sc_10011_result(Rest, N + 7, X bsl N + Acc,
			    F@_1, F@_2, TrUserData);
