d_field_sc_10011_cpOrderId(<<1:1, X:7, Rest/binary>>, N,
			   Acc, F@_1, F@_2, TrUserData)
    when N < 57 ->
    d_field_sc_10011_cpOrderId(Rest, N + 7, X bsl N + Acc,
			       F@_1, F@_2, TrUserData);
d_field_sc_10011_cpOrderId(<<0:1, X:7, Rest/binary>>, N,
