				TrUserData).

skip_group_sc_10011(Bin, FNum, Z2, F@_1, F@_2,
		    TrUserData) ->
    {_, Rest} = read_group(Bin, FNum),
    dfp_read_field_def_sc_10011(Rest, 0, Z2, F@_1, F@_2,
				TrUserData).

skip_32_sc_10011(<<_:32, Rest/binary>>, Z1, Z2, F@_1,
		 F@_2, TrUserData) ->
    dfp_read_field_def_sc_10011(Rest, Z1, Z2, F@_1, F@_2,
				TrUserData).

skip_64_sc_10011(<<_:64, Rest/binary>>, Z1, Z2, F@_1,
		 F@_2, TrUserData) ->
    dfp_read_field_def_sc_10011(Rest, Z1, Z2, F@_1, F@_2,
				TrUserData).

read_group(Bin, FieldNum) ->
    {NumBytes, EndTagLen} = read_gr_b(Bin, 0, 0, 0, 0, FieldNum),
    <<Group:NumBytes/binary, _:EndTagLen/binary, Rest/binary>> = Bin,
    {Group, Rest}.

%% Like skipping over fields, but record the total length,
%% Each field is <(FieldNum bsl 3) bor FieldType> ++ <FieldValue>
%% Record the length because varints may be non-optimally encoded.
%%
%% Groups can be nested, but assume the same FieldNum cannot be nested
%% because group field numbers are shared with the rest of the fields
%% numbers. Thus we can search just for an group-end with the same
%% field number.
%%
%% (The only time the same group field number could occur would
%% be in a nested sub message, but then it would be inside a
%% length-delimited entry, which we skip-read by length.)
read_gr_b(<<1:1, X:7, Tl/binary>>, N, Acc, NumBytes, TagLen, FieldNum)
  when N < (32-7) ->
    read_gr_b(Tl, N+7, X bsl N + Acc, NumBytes, TagLen+1, FieldNum);
read_gr_b(<<0:1, X:7, Tl/binary>>, N, Acc, NumBytes, TagLen,
          FieldNum) ->
    Key = X bsl N + Acc,
    TagLen1 = TagLen + 1,
    case {Key bsr 3, Key band 7} of
        {FieldNum, 4} -> % 4 = group_end
            {NumBytes, TagLen1};
        {_, 0} -> % 0 = varint
            read_gr_vi(Tl, 0, NumBytes + TagLen1, FieldNum);
        {_, 1} -> % 1 = bits64
            <<_:64, Tl2/binary>> = Tl,
            read_gr_b(Tl2, 0, 0, NumBytes + TagLen1 + 8, 0, FieldNum);
        {_, 2} -> % 2 = length_delimited
            read_gr_ld(Tl, 0, 0, NumBytes + TagLen1, FieldNum);
        {_, 3} -> % 3 = group_start
            read_gr_b(Tl, 0, 0, NumBytes + TagLen1, 0, FieldNum);
        {_, 4} -> % 4 = group_end
            read_gr_b(Tl, 0, 0, NumBytes + TagLen1, 0, FieldNum);
        {_, 5} -> % 5 = bits32
            <<_:32, Tl2/binary>> = Tl,
            read_gr_b(Tl2, 0, 0, NumBytes + TagLen1 + 4, 0, FieldNum)
    end.

read_gr_vi(<<1:1, _:7, Tl/binary>>, N, NumBytes, FieldNum)
  when N < (64-7) ->
    read_gr_vi(Tl, N+7, NumBytes+1, FieldNum);
read_gr_vi(<<0:1, _:7, Tl/binary>>, _, NumBytes, FieldNum) ->
    read_gr_b(Tl, 0, 0, NumBytes+1, 0, FieldNum).

read_gr_ld(<<1:1, X:7, Tl/binary>>, N, Acc, NumBytes, FieldNum)
  when N < (64-7) ->
    read_gr_ld(Tl, N+7, X bsl N + Acc, NumBytes+1, FieldNum);
read_gr_ld(<<0:1, X:7, Tl/binary>>, N, Acc, NumBytes, FieldNum) ->
    Len = X bsl N + Acc,
    NumBytes1 = NumBytes + 1,
    <<_:Len/binary, Tl2/binary>> = Tl,
    read_gr_b(Tl2, 0, 0, NumBytes1 + Len, 0, FieldNum).

merge_msgs(Prev, New) -> merge_msgs(Prev, New, []).

merge_msgs(Prev, New, Opts)
    when element(1, Prev) =:= element(1, New) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case Prev of
      #sc_10001{} ->
	  merge_msg_sc_10001(Prev, New, TrUserData);
      #cs_10000{} ->
	  merge_msg_cs_10000(Prev, New, TrUserData);
      #sc_10010{} ->
	  merge_msg_sc_10010(Prev, New, TrUserData);
      #sc_10000{} ->
	  merge_msg_sc_10000(Prev, New, TrUserData);
      #cs_10010{} ->
	  merge_msg_cs_10010(Prev, New, TrUserData);
      #cs_10011{} ->
	  merge_msg_cs_10011(Prev, New, TrUserData);
      #cs_10001{} ->
	  merge_msg_cs_10001(Prev, New, TrUserData);
      #sc_10011{} -> merge_msg_sc_10011(Prev, New, TrUserData)
    end.

merge_msg_sc_10001(#sc_10001{matchId = PFmatchId},
		   #sc_10001{result = NFresult, roomId = NFroomId,
			     matchId = NFmatchId},
		   _) ->
    #sc_10001{result = NFresult, roomId = NFroomId,
	      matchId =
		  if NFmatchId =:= undefined -> PFmatchId;
		     true -> NFmatchId
		  end}.

merge_msg_cs_10000(#cs_10000{params = PFparams},
		   #cs_10000{openId = NFopenId, sign = NFsign,
			     timestamp = NFtimestamp, appId = NFappId,
			     params = NFparams},
		   TrUserData) ->
    #cs_10000{openId = NFopenId, sign = NFsign,
	      timestamp = NFtimestamp, appId = NFappId,
	      params =
		  if PFparams /= undefined, NFparams /= undefined ->
			 'erlang_++'(PFparams, NFparams, TrUserData);
		     PFparams == undefined -> NFparams;
		     NFparams == undefined -> PFparams
		  end}.

merge_msg_sc_10010(#sc_10010{cpOrderId = PFcpOrderId,
			     cpPropName = PFcpPropName, cpPropId = PFcpPropId,
			     payAmount = PFpayAmount},
		   #sc_10010{result = NFresult, cpOrderId = NFcpOrderId,
			     cpPropName = NFcpPropName, cpPropId = NFcpPropId,
			     payAmount = NFpayAmount},
		   _) ->
    #sc_10010{result = NFresult,
	      cpOrderId =
		  if NFcpOrderId =:= undefined -> PFcpOrderId;
		     true -> NFcpOrderId
		  end,
	      cpPropName =
		  if NFcpPropName =:= undefined -> PFcpPropName;
		     true -> NFcpPropName
		  end,
	      cpPropId =
		  if NFcpPropId =:= undefined -> PFcpPropId;
		     true -> NFcpPropId
		  end,
	      payAmount =
		  if NFpayAmount =:= undefined -> PFpayAmount;
		     true -> NFpayAmount
		  end}.

merge_msg_sc_10000(#sc_10000{nickname = PFnickname,
			     avatarUrl = PFavatarUrl, openId = PFopenId},
		   #sc_10000{result = NFresult, playerId = NFplayerId,
			     nickname = NFnickname, avatarUrl = NFavatarUrl,
			     openId = NFopenId},
		   _) ->
    #sc_10000{result = NFresult, playerId = NFplayerId,
	      nickname =
		  if NFnickname =:= undefined -> PFnickname;
		     true -> NFnickname
		  end,
	      avatarUrl =
		  if NFavatarUrl =:= undefined -> PFavatarUrl;
		     true -> NFavatarUrl
		  end,
	      openId =
		  if NFopenId =:= undefined -> PFopenId;
		     true -> NFopenId
		  end}.

merge_msg_cs_10010(#cs_10010{},
		   #cs_10010{cpPropId = NFcpPropId}, _) ->
    #cs_10010{cpPropId = NFcpPropId}.

merge_msg_cs_10011(#cs_10011{},
		   #cs_10011{cpOrderId = NFcpOrderId}, _) ->
    #cs_10011{cpOrderId = NFcpOrderId}.

merge_msg_cs_10001(#cs_10001{matchId = PFmatchId},
		   #cs_10001{gameMode = NFgameMode,
			     matchType = NFmatchType, matchId = NFmatchId},
		   _) ->
    #cs_10001{gameMode = NFgameMode,
	      matchType = NFmatchType,
	      matchId =
		  if NFmatchId =:= undefined -> PFmatchId;
		     true -> NFmatchId
		  end}.

merge_msg_sc_10011(#sc_10011{},
		   #sc_10011{result = NFresult, cpOrderId = NFcpOrderId},
		   _) ->
    #sc_10011{result = NFresult, cpOrderId = NFcpOrderId}.


verify_msg(Msg) -> verify_msg(Msg, []).

verify_msg(Msg, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case Msg of
      #sc_10001{} ->
	  v_msg_sc_10001(Msg, [sc_10001], TrUserData);
      #cs_10000{} ->
	  v_msg_cs_10000(Msg, [cs_10000], TrUserData);
      #sc_10010{} ->
	  v_msg_sc_10010(Msg, [sc_10010], TrUserData);
      #sc_10000{} ->
	  v_msg_sc_10000(Msg, [sc_10000], TrUserData);
      #cs_10010{} ->
	  v_msg_cs_10010(Msg, [cs_10010], TrUserData);
      #cs_10011{} ->
	  v_msg_cs_10011(Msg, [cs_10011], TrUserData);
      #cs_10001{} ->
	  v_msg_cs_10001(Msg, [cs_10001], TrUserData);
      #sc_10011{} ->
	  v_msg_sc_10011(Msg, [sc_10011], TrUserData);
      _ -> mk_type_error(not_a_known_message, Msg, [])
    end.


-dialyzer({nowarn_function,v_msg_sc_10001/3}).
v_msg_sc_10001(#sc_10001{result = F1, roomId = F2,
			 matchId = F3},
	       Path, _) ->
    v_type_int32(F1, [result | Path]),
    v_type_int64(F2, [roomId | Path]),
    if F3 == undefined -> ok;
       true -> v_type_string(F3, [matchId | Path])
    end,
    ok.

-dialyzer({nowarn_function,v_msg_cs_10000/3}).
v_msg_cs_10000(#cs_10000{openId = F1, sign = F2,
			 timestamp = F3, appId = F4, params = F5},
	       Path, _) ->
    v_type_string(F1, [openId | Path]),
    v_type_string(F2, [sign | Path]),
    v_type_int32(F3, [timestamp | Path]),
    v_type_int32(F4, [appId | Path]),
    if is_list(F5) ->
	   _ = [v_type_string(Elem, [params | Path])
		|| Elem <- F5],
	   ok;
       true ->
	   mk_type_error({invalid_list_of, string}, F5,
			 [params | Path])
    end,
    ok.

-dialyzer({nowarn_function,v_msg_sc_10010/3}).
v_msg_sc_10010(#sc_10010{result = F1, cpOrderId = F2,
			 cpPropName = F3, cpPropId = F4, payAmount = F5},
	       Path, _) ->
    v_type_int32(F1, [result | Path]),
    if F2 == undefined -> ok;
       true -> v_type_string(F2, [cpOrderId | Path])
    end,
    if F3 == undefined -> ok;
       true -> v_type_string(F3, [cpPropName | Path])
    end,
    if F4 == undefined -> ok;
       true -> v_type_string(F4, [cpPropId | Path])
    end,
    if F5 == undefined -> ok;
       true -> v_type_int32(F5, [payAmount | Path])
    end,
    ok.

-dialyzer({nowarn_function,v_msg_sc_10000/3}).
v_msg_sc_10000(#sc_10000{result = F1, playerId = F2,
			 nickname = F3, avatarUrl = F4, openId = F5},
	       Path, _) ->
    v_type_int32(F1, [result | Path]),
    v_type_int64(F2, [playerId | Path]),
    if F3 == undefined -> ok;
       true -> v_type_string(F3, [nickname | Path])
    end,
    if F4 == undefined -> ok;
       true -> v_type_string(F4, [avatarUrl | Path])
